+	      {
+		if (TYPE_NAME (type) == 0)
+		  warning ("case value `%d' not in enumerated type",
+			   TREE_INT_CST_LOW (n->high));
+		else
+		  warning ("case value `%d' not in enumerated type `%s'",
+			   TREE_INT_CST_LOW (n->high),
+			   IDENTIFIER_POINTER ((TREE_CODE (TYPE_NAME (type))
+						== IDENTIFIER_NODE)
